import React from "react"; //import React library

/* Your code goes here */
export function TableHeader(props) {
  let columnNames = props.columnNames;
  let tableElements = columnNames.map((name) => {
    let thisTH = <th key={name}>{name}</th>;
    return thisTH;
  });
  return (
    <thead>
      <tr>{tableElements}</tr>
    </thead>
  );
}
